INSERT [dbo].[Posts] ([ID], [Title], [Image], [Content], [Status]) VALUES (1, N'Dòng sản phẩm công nghệ EXCOOL', N'UploadFiles/Posts/photo-1-16337533727311530744491-1633765958855-163376595898855589547.jpg', N'Một công nghệ mới được sử dụng tạo bởi người Việt, đánh cho người Việt với nhiều ưu điểm vượt trội.
Tính năng nổi bật của Excool: Siêu nhẹ, đàn hồi, co giãn, thấm hút tốt, nhanh khô, chống tia UV, độ bền cao dễ chăm sóc, khử mùi,  đặc biệt là thân thiện với môi trường
Các sản phẩm dòng Excool tập trung vào các tính năng COOLING, mát mẻ, siêu nhẹ, nhanh khô, bền, dễ chăm sóc, không nhăn và đặc biệt là thân thiện với môi trường.', 1)
INSERT [dbo].[Posts] ([ID], [Title], [Image], [Content], [Status]) VALUES (2, N'Top 5 chất liệu may áo sơ mi phổ biến nhất hiện nay', N'UploadFiles/Posts/chat-lieu-ao-so-mi-1.jpg', N'1. Chất liệu may áo sơ mi - Vải kate
2. Chất liệu may áo sơ mi - Vải Kaki
3.Chất liệu may áo sơ mi: Vải sợi nano
