5.Chất liệu áo sơ mi: Vải voan', 1)
INSERT [dbo].[Posts] ([ID], [Title], [Image], [Content], [Status]) VALUES (3, N'Đặc điểm của chất liệu vải kaki', N'UploadFiles/Posts/vai-kaki-11_59.png', N'Vải kaki là chất liệu vải được sử dụng rộng rãi trong ngành may mặc trên toàn thế giới. Tất cả các loại vải kaki được dệt từ cotton hoặc sợi cotton đan chéo với sợi tổng hợp. Loại vải này có tính chất nổi bật là bền, mát, không nhăn, co giãn tốt tuy nhiên nó cũng khá cứng và dày.
Ưu điểm: Độ bền tương đối cao, ít nhăn và không bị xù lông, Dễ dàng nhuộm màu, Thân thiện với môi trường
Nhược điểm: Không phù hợp với các thiết kế cầu kì, Giá thành cao', 1)
INSERT [dbo].[Posts] ([ID], [Title], [Image], [Content], [Status]) VALUES (5, N'Thời trang Vintage là gì?', N'UploadFiles/Posts/phong-cach-thoi-trang-vintage-6.png', N'Vintage ban đầu vốn là một khái niệm chỉ sự “xưa-cũ” thường được ứng dụng trong ngành sản xuất rượu hoặc dầu. Sau đó dần dần được ứng dụng rộng rãi hơn đến các lĩnh vực như xe hơi, đồ họa, nội thất... Trong thời trang, khái niệm Vintage đang ngày càng phổ biến và lên ngôi ở khắp các sàn diễn, tạp chí cũng như trong phong cách đường phố đương đại.
Quần áo Vintage thường chỉ những mẫu trang phục rất đẹp và tinh tế thuộc thời đại cũ. Các thiết kế Vintage thường được ra đời trong khoảng thập niên 30 - 60 và thịnh hành trong khoảng thập niên 90 của thế kỷ trước.
Phong cách thời trang Vintage chỉ lối ăn mặc cổ điển, khơi gợi nét đẹp của quá khứ để làm điểm nhấn cho outfit. Để làm nên “phong cách Vintage”, người mặc có thể lựa chọn tái sử dụng chính các thiết kế xưa cũ hoặc các item được làm ra ở hiện tại nhưng mang nhiều nét đặc trưng của các thập kỷ trước.', 1)
INSERT [dbo].[Posts] ([ID], [Title], [Image], [Content], [Status]) VALUES (6, N'Street Style là gì?', N'UploadFiles/Posts/phong-cach-street-style-3.png', N'Đúng như tên gọi, Street Style là từ mô tả phong cách thời trang đường phố. Không giống như những phong cách thời trang khác, Street Style được sinh ra từ đường phố chứ không phải tại các sàn diễn hay bộ sưu tập hoành tráng. Cũng bởi lý do này, thời trang Street Style là sự tổng hòa của rất nhiều nét cá tính và phong cách thời trang khác nhau.
Điểm mấu chốt trong phong cách thời trang Street Style là sự năng động, ngẫu hứng và không thể thiếu bản sắc cá nhân. Thời trang Street Style không gò bó trong những quy chuẩn khắt khe, mà mang tính tự do thể hiện bản sắc riêng, cùng sự ảnh hưởng không nhỏ của hiệu ứng lan truyền (viral) và văn hóa Hip-hop.
Trong dòng chảy của thời trang, Street Style ngày càng được công nhận nhiều hơn của các nhà thiết kế lừng danh lẫn các hãng thời trang hàng đầu. Dễ thấy đó là sự xuất hiện của các item mang đậm chất đường phố như chiếc quần “Punk” bó sát hay những mẫu váy dài “Hippy” cũng dần được nhìn nhận nghiêm túc hơn và xuất hiện nhiều hơn trong các show diễn đình đám.', 1)
INSERT [dbo].[Posts] ([ID], [Title], [Image], [Content], [Status]) VALUES (7, N'Phong cách thời trang là gì?', N'UploadFiles/Posts/phong-cach-thoi-trang-00.png', N'Thời trang là một sự thể hiện thẩm mỹ phổ biến tại một thời gian, địa điểm cụ thể, trong một bối cảnh cụ thể bằng cách sử dụng quần áo, giày dép, phụ kiện, cách trang điểm, kiểu tóc và tỷ lệ cơ thể.
Phong cách thời trang là cách lựa chọn và phối trang phục tạo nét riêng độc đáo, thể hiện được phong cách sống cá nhân vốn có của bạn, đồng thời bộc lộ được vẻ đẹp của bạn, đó là sự độc nhất.
Sự khác nhau giữa thời trang và phong cách thời trang
Theo nhà xã hội học Pierre Bourdieu, thời trang có nghĩa là “thời trang mới nhất, sự khác biệt mới nhất”.
Phong cách thời trang là một biểu hiện kéo dài qua nhiều mùa và thường được kết nối với các phong trào văn hóa và các dấu hiệu xã hội, biểu tượng, giai cấp, và văn hóa.
Coco Chanel đã từng nói “Fashion fades, only style remains the same” tam dịch là “Thời trang thì sẽ tàn phai dần, chỉ có phong cách là vĩnh cửu”. Qua câu nói này mới thấy cốt lõi của thời trang chính là phong cách.', 1)
INSERT [dbo].[Posts] ([ID], [Title], [Image], [Content], [Status]) VALUES (8, N'Những món đồ bạn luôn luôn thu hút?', N'UploadFiles/Posts/phong-cach-thoi-trang-02-676x400.png', N'Bạn có biết khoảnh khắc đó khi bạn bước vào một cửa hàng quần áo và ngay lập tức bị hút về một cái gì đó? Những món đồ đó là gì và chúng thường có điểm chung gì?
Bạn luôn luôn ấn tượng với màu sắc tươi sáng? In đậm? Hoặc các mẫu đơn giản hơn và phối màu trung tính? Có lẽ có một chủ đề thậm chí còn lớn hơn mà bạn bị thu hút như rung cảm phong cách preppy, nữ tính của những năm 1950, các chi tiết phóng túng, các mặt hàng chủ lực kiểu dáng đẹp và sang trọng, hoặc hình bóng cổ điển.
Lưu ý trọng lực tự nhiên mà bạn có đối với một loại quần áo so với loại khác có thể giúp bạn hiểu được phong cách nào bạn thực sự thích và rất có thể sẽ mặc. Ngoài ra, lưu ý đến phong cách chung của các cửa hàng bạn thường xuyên mua sắm có thể giúp bạn thu hẹp phong cách cá nhân của riêng bạn. Có một lý do tại sao bạn tiếp tục mua sắm ở đó! Tuy nhiên, có rất nhiều bạn ngỡ ngàng vì sau khi lựa chọn tìm thứ yêu thích, quay trở lại tủ quần áo nó khác với gì bạn lựa chọn, và cảm thấy hối tiếc.', 1)
INSERT [dbo].[Posts] ([ID], [Title], [Image], [Content], [Status]) VALUES (9, N'Những gam màu hòa hợp với trời thu', N'UploadFiles/Posts/nhung-gam-mau-hoa-hop-voi-troi-thu-cho-ban-dien-mao-sang-chanh-hon-123734.png', N'Màu vàng
Mùa thu gắn liền với màu vàng của hoa cúc và lá vàng. Sắc vàng dường như là biểu tượng, nét đặc trưng của mùa thu và thời trang màu vàng sẽ hòa quyện với sắc màu đất trời. Màu vàng cũng là màu nổi bật tôn da nên khi mặc màu vàng bạn sẽ thấy sự tươi sáng và cảm giác có vận may hứng khởi. 
Màu hồng
Màu hồng là màu sắc có thể khiến người ta cảm thấy sến súa. Nhưng vì thời tiết mùa thu mát mẻ nên màu hồng sẽ giúp bạn trở nên rực rỡ mà không bị nóng. Màu hồng cũng rất đa dạng từ tông đậm tới nhạt thỏa thích lựa chọn. 
Màu đỏ
Đỏ là một màu sắc nổi bật và không hợp với ngày nắng nóng nhưng lúc sang thu là khi bạn có thể chọn màu yêu thích này rồi. Màu đỏ thể hiện quyền lực và sự nồng nhiệt, thể hiện sức mạnh và tạo hứng khởi. Một ngày thu lạnh và ảm đạm thì màu đỏ sẽ cực kỳ hữu dụng cho tâm trạng của bạn. Nếu bạn có làn da trắng thì màu đỏ càng giúp bạn tôn lên nước da trắng mịn này và cho bạn hồng hào hơn, tươi sáng hơn.
Màu nâu
Màu nâu là tông màu trầm hay khiến người ta cảm thấy buồn và già hơn trước tuổi. Nhưng đây cũng là màu sắc của sự sang trọng và chín chắn. Lúc sang thu là lúc thích hợp nhất để chọn màu này. Bạn có thể kết hợp chúng với một số phụ kiện nổi bật hơn như túi đỏ, chocker đỏ, đai lưng đỏ...
Với các gam màu sắc trên bạn hoàn toàn có thể phối trong ngày thu mát mẻ hoặc ảm đạm. Màu sắc không chỉ phù hợp với làn da, mà nó là câu chuyện của hợp mùa và nó ảnh hưởng lên tâm lý người mặc. Do đó khi bạn chọn được sắc màu hợp lý bạn sẽ thấy thoải mái hơn khi diện bộ đồ đó.', 1)
